  false,\n\t\"url\": null,\n\t\"notes\": \"Butterfly (adult Lepidoptera) survey conducted
  monthly (May-Nov 2001) at nine locations within Pinckney Island NWR. These nine
  locations include Ibis Pond, Woodstork Pond Field, Osprey Pond Field, Big Oak Field,
  Boat Ramp, White Point Field, Old-Plantation Road / Residence to Bull Point, along
  the Main Road, and on Shell Point Field. Butterflies were surveyed at the above
  nine sites, by Janet C. Daniels and refuge staff and volunteers on May 13, June
  30, August 18, September 29, October 20, and in November (2001).\",\n\t\"license_title\":
